import LogoImage from "./../../assets/images/logo.jpg";

function Header() {
  return (
    <header>
      <div className="d-flex justify-content-between">
        <Logo></Logo>
        <LoginControl></LoginControl>
      </div>
      <Titulo></Titulo>
      <BannerImage></BannerImage>
    </header>
  );
}

export default Header;
